import React from "react";

import { FaTrash, FaEdit } from "react-icons/fa";

import axios from "axios";

import { Table, Thead, Tr, Th, Tbody } from "../styles/Grid";

export const Grid = ({ clinicas }) => {
  return(
    <>
      <Table>
        <Thead>
          <Tr>
            <Th>Código</Th>
            <Th>Nome</Th>
            <Th>Endereço</Th>
            <Th onlyWeb>Telefone</Th>
            <Th>Email</Th>
            <Th></Th>
            <Th></Th>
          </Tr>
        </Thead>
        <Tbody>
          {clinicas.map((item, i) => {
            <Tr key={i}>
              <Td width="30%">{item.CodCli}</Td>
              <Td width="30%">{item.NomeCli}</Td>
              <Td width="30%">{item.Endereco}</Td>
              <Td width="30%">{item.Telefone}</Td>
              <Td width="30%">{item.Email}</Td>
            </Tr>
          })}
        </Tbody>

      </Table>
    </>
  )
}
